//	449. Serialize and Deserialize BST
//
//	Serialization is the process of converting a data structure or object into a sequence of bits so that 
//	it can be stored in a file or memory buffer, 
//	or transmitted across a network connection link to be reconstructed later in the same or another computer environment.
//
//	Design an algorithm to serialize and deserialize a binary search tree.
//	There is no restriction on how your serialization / deserialization algorithm should work.
//	You just need to ensure that a binary search tree can be serialized to a string and 
//	this string can be deserialized to the original tree structure.
//
//	The encoded string should be as compact as possible.
//
//	Note: Do not use class member / global / static variables to store states.
//		Your serialize and deserialize algorithms should be stateless.
//
//	Written by Zhanran Tang @ 8/22/2017
//
//	Ideas: Use 4 char for 1 number and encode the value in preoder.
//	Complexity: O(n) in time in serialize and deserialize, O(1) in space.

#include "Header.h"

using namespace std;

#include "Header.h"

using namespace std;

string encodeInt(int val)
{
	string res = "";
	int mask = 255;
	for (int i = 0; i < 4; i++)
	{
		int bit = val & mask;
		res += bit;
		val = val >> 8;
	}
	return res;
}

int decodeInt(string encodeval)
{
	int res = 0;
	for (int i = 3; i >= 1; i--)
	{

		res = res | (unsigned char)encodeval[i];
		res = res << 8;
	}
	return res | (unsigned char)encodeval[0];
}

void preOrder(string &str, TreeNode* root)
{
	if (root != nullptr)
	{
		str += encodeInt(root->val);
		preOrder(str, root->left);
		preOrder(str, root->right);
	}
}

TreeNode* bulidTree(string data, int low, int upper, int &i)
{
	if (i >= data.length())
		return nullptr;
	int tmpi = i;
	int val = decodeInt(data.substr(tmpi, 4));
	tmpi += 4;
	if (val<low || val>upper)
		return nullptr;
	i = tmpi;
	TreeNode* node = new TreeNode(val);
	node->left = bulidTree(data, low, val, i);
	node->right = bulidTree(data, val, upper, i);
	return node;
}

// Encodes a tree to a single string.
string serialize(TreeNode* root)
{
	string res = "";
	preOrder(res, root);
	return res;
}

// Decodes your encoded data to tree.
TreeNode* deserialize(string data)
{
	int i = 0;
	TreeNode* root = bulidTree(data, INT_MIN, INT_MAX, i);
	return root;
}

